import React, { useEffect, useRef, useState} from 'react';
import "./Presentation.css"

const Presentation = () => {
  return (
      <div className="body">
         <img src={process.env.PUBLIC_URL + "assets/imgs/purple_women.png"} alt='Women picture'/>
         <h3>Permettez à la nouvelle étoile montante de la musique de se démarquer.</h3>
         <div>Chaque semaine, le vainqueur de notre concours ROOTS® sera mis en avant sur nos différents réseaux ainsi que sur ceux de nos partenaires officiels, Spotify et RTL.</div>
         <img src={process.env.PUBLIC_URL + "assets/imgs/spotify_logo.svg"} alt='Women picture'/>
         <img src={process.env.PUBLIC_URL + "assets/imgs/RTL.svg"} alt='Women picture'/>
      </div>
  );
};

export default Presentation;
